export default function Footer() {
  const { auth, setAuth } = useContext(AuthContext);

  return (
    <nav id="bottomNav">
      <div
        style={{
          flex: 1,
          display: "flex",
          alignItems: "center",
        }}
      >
        <div className="navButton">
          <AiOutlineUser />
        </div>
      </div>
      <input type="text" />
      <div
        style={{
          flex: 1,
          display: "flex",
          alignItems: "center",
          justifyContent: "flex-end",
        }}
      >
        <div className="navButton">
          <AiOutlineLogout />
        </div>
      </div>
    </nav>
  );
}
